  input: "\"TEXT\",\"F3XA\",\"C00143743\",\"March 26, 2007    Daniel Buckley  Federal
    Election Commission  Washington DC 20463    Re:\tAmended 12 Day Pre General  (October
    \ 1, to October 18, 2006)    Pursuant to your letter dated, February 23, 2007,
    regarding the Amended 12 Day Pre-General Report, we are responding to your questions
    as follows:  During our reconciliation and review, we identified a $54 reduction
    in contributions and increase in expenditures of $1,393.74.  With other amended
    reports filed on March 26, 2007, the net change in cash on hand is $1,348.87.
    \    Outstanding balances for debt obligations have been corrected to reflect
    payments for vendor activity shown on Schedule H6 previously missing in the payments
    section of Schedule D.    H6 year to data totals for Generic Campaign Activity
    categories have been corrected and reflected on this report.    H4 activity previously
    showing 100% non-federal activity for fundraising events has been moved to line
    21b to indicate payment of expenses with 100% federal funds as permissible.  This
    reflects the ending ratio of funds raised between the federal and non-federal
    accounts.  These events, previously reflected on H2 have been removed from H2.
    \ One event remains on H2 and H4 and reflects the ratio of federal and non-federal
    funds expected ratio and is reported correctly    Allocated activity reported
    on H4 year to date totals are correct on lines 21ai and 21aii.    As a result
    of software upgrade on March 5, 2007, we are no longer able to sort our data based
    on date of expenditure.   The software program however, reflects a date total
    on each record.  Consequently, each record shows a  year to date total for the
    type of activity based on date, but the random reporting by name of the expenditures,
    makes the year to date totals appear incorrect.  After careful reconciliation
    of each activity, the totals reflected on lines 21ai and 21aii are correct for
    the allocated expenditures.  Respectfully submitted, Wayne Tucker, Treasurer\""
